import React from 'react';
import { Link } from 'react-router-dom';

const NotFound = () => {
  return (
    <div className="flex flex-col items-center justify-center h-screen">
      <h1 className="text-4xl font-bold text-gray-800 mb-4">404 - Page Not Found</h1>
      <p className="text-lg text-gray-600 mb-8">Oops! It seems like you are not logged-in.please logi</p>
      <Link to="/" className="text-lg text-white bg-blue-500 px-6 py-3 rounded-lg hover:bg-blue-600 transition duration-300 ease-in-out">Go back to Home</Link>
      <Link to="/login" className="text-lg text-white bg-blue-500 px-6 py-3 rounded-lg hover:bg-blue-600 transition duration-300 ease-in-out">Redirect to login page </Link>
    </div>
  );
};

export default NotFound;
